    var MockLivefyreBootstrapClient = function (opts) {
        opts = opts || {};
        this._featuredInit = opts.featuredInit;
        LivefyreBootstrapClient.apply(this, arguments);
    };

    inherits(MockLivefyreBootstrapClient, LivefyreBootstrapClient);


    MockLivefyreBootstrapClient.prototype.getContent = function (opts, errback) {
        var response;
        if (typeof opts.page === 'undefined') {
            response = mockInitResponse;
            if (this._featuredInit) {
                response = mockFeaturedInitResponse;
            }
        } else if (opts.page === 'featured-all') {
            response = mockFeaturedAllResponse;
        } else {
            response = mockPageResponse;
        }
        errback(null, response);
    };


    MockLivefyreBootstrapClient.mockInitWithFeatured = mockFeaturedInitResponse;
    MockLivefyreBootstrapClient.mockInitResponse = mockInitResponse;
    return MockLivefyreBootstrapClient;
